import React from 'react';
import '../stylesheets/Header.scss';
import picture from '../images/Yolanda.jpeg';

function Header() {
  return (
    <div className="App">

       <img src={picture} className="header__imge" alt="logo" />
       <div>
       <h1>Yolanda Vergara</h1>
       <p>Lunes 16 de Diciembre de 2019</p>
       </div>

    </div>
  );
}

export default Header;
